/*Table structure for table `mall_goods_category` */

DROP TABLE IF EXISTS `mall_goods_category`;

CREATE TABLE `mall_goods_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT NULL COMMENT '父类别id',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `category_name` varchar(100) DEFAULT NULL COMMENT '类别名称',
  `category_level` int(1) DEFAULT '0' COMMENT '类别级别',
  `category_status` int(1) DEFAULT '1' COMMENT '类别状态 1启用，2禁用',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `is_delete` int(3) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_mgc_id` (`is_delete`) USING BTREE,
  KEY `ix_mgc_si` (`store_id`) USING BTREE,
  KEY `ix_mgc_pi` (`parent_id`) USING BTREE
