/*Table structure for table `mall_goods_stock` */

DROP TABLE IF EXISTS `mall_goods_stock`;

CREATE TABLE `mall_goods_stock` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) DEFAULT NULL COMMENT '商品id',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `detail_name` varchar(100) DEFAULT NULL COMMENT 'sku商品名称',
  `property_label` varchar(100) DEFAULT NULL COMMENT '商品属性标签',
  `sell_price` decimal(18,2) DEFAULT NULL COMMENT '销售价',
  `repertory` int(11) DEFAULT '0' COMMENT '商品库存',
  `lock_repertory` int(11) DEFAULT NULL COMMENT '商品锁定库存',
  `goods_no` varchar(32) DEFAULT NULL COMMENT '商品编码（商家编码）',
  `cost_price` decimal(18,2) DEFAULT NULL COMMENT '成本价',
  `sell_num` int(11) DEFAULT '0' COMMENT '销售量',
  `is_delete` int(3) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_mgs_id` (`is_delete`) USING BTREE,
  KEY `ix_mgs_gi` (`goods_id`) USING BTREE,
  KEY `ix_mgs_si` (`store_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=520 DEFAULT CHARSET=utf8 COMMENT='商城-商品库存明细';

