/*Table structure for table `mall_logistics` */

DROP TABLE IF EXISTS `mall_logistics`;

CREATE TABLE `mall_logistics` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL COMMENT '商城id',
  `template_name` varchar(250) DEFAULT NULL COMMENT '模板名称',
  `express_company` varchar(250) DEFAULT NULL COMMENT '快递公司，字典维护',
  `charge_mode` int(1) DEFAULT NULL COMMENT '计费模式 1按件 2按重量',
  `first_piece` varchar(20) DEFAULT NULL COMMENT '首件个数/首重个数',
  `add_piece` varchar(20) DEFAULT NULL COMMENT '续件个数/续重个数',
  `first_price` decimal(18,2) DEFAULT NULL COMMENT '首件费用/首重费用',
  `add_price` decimal(18,2) DEFAULT NULL COMMENT '续件费用/续重费用',
  `init_state` int(1) DEFAULT NULL COMMENT '启用状态 1启用 2不启用',
  `is_delete` int(1) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_ml_id` (`is_delete`) USING BTREE,
  KEY `ix_ml_si` (`store_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=utf8 COMMENT='商城-物流';

/*Data for the table `mall_logistics` */

/*Table structure for table `mall_logistics_company` */

DROP TABLE IF EXISTS `mall_logistics_company`;

CREATE TABLE `mall_logistics_company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `exp_name` varchar(50) DEFAULT NULL COMMENT '物流公司',
  `exp_code` varchar(32) DEFAULT NULL COMMENT '物流公司编码',
  `is_delete` int(3) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_mlc_ui` (`user_id`) USING BTREE,
  KEY `ix_mlc_si` (`store_id`) USING BTREE
