/*Table structure for table `mall_temp_showcase` */

DROP TABLE IF EXISTS `mall_temp_showcase`;

CREATE TABLE `mall_temp_showcase` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `show_type` int(1) DEFAULT NULL COMMENT '展示方式',
  `goods_name_status` int(1) DEFAULT NULL COMMENT '商品名称显示 1显示 0隐藏',
  `goods_price_status` int(1) DEFAULT NULL COMMENT '价格显示 1 显示 2 隐藏',
  `buy_button_status` int(1) DEFAULT NULL COMMENT '按钮状态 1显示 0隐藏',
  `is_delete` int(1) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_mts_id` (`is_delete`) USING BTREE,
  KEY `ix_mts_si` (`store_id`) USING BTREE
