/*Table structure for table `sys_company_wxconfig` */

DROP TABLE IF EXISTS `sys_company_wxconfig`;

CREATE TABLE `sys_company_wxconfig` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `company_type` varchar(255) DEFAULT NULL COMMENT '公司的类型',
  `appid` varchar(500) DEFAULT NULL COMMENT '小程序APPID',
  `secret` varchar(500) DEFAULT NULL COMMENT '小程序的secret',
  `token` varchar(500) DEFAULT NULL COMMENT '自定义的交到token',
  `msg_data_format` varchar(255) DEFAULT 'JSON' COMMENT '交互数据的格式',
  `aesKey` varchar(500) DEFAULT NULL COMMENT '支付密钥',
  `partner` varchar(255) DEFAULT NULL COMMENT '支付号',
  `partnerkey` varchar(500) DEFAULT NULL COMMENT '支付号密钥',
  `payment_page` varchar(500) DEFAULT NULL COMMENT '调起支付的页面路径',
  `create_ip` varchar(255) DEFAULT NULL COMMENT '调用微信支付的IP地址',
  `notify_url` varchar(500) DEFAULT NULL COMMENT '支付成功后的回调页面',
  `is_delete` int(1) DEFAULT '0' COMMENT '1删除 0正常',
  `create_time` datetime DEFAULT NULL,
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ix_company_id` (`company_id`,`company_type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8;

