  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `store_id` int(11) DEFAULT NULL COMMENT '门店的id',
  `company_type` varchar(255) DEFAULT NULL,
  `authorizer_appid` varchar(255) DEFAULT NULL COMMENT '授权方的appid',
