/*Table structure for table `sys_notice_info` */

DROP TABLE IF EXISTS `sys_notice_info`;

CREATE TABLE `sys_notice_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `theme` varchar(255) DEFAULT NULL COMMENT '公告类别（1系统公告,2产品动态，3其他）',
  `content` varchar(255) DEFAULT NULL COMMENT '文字内容',
  `to_object` varchar(255) DEFAULT NULL COMMENT '推送对象（1誉道   2为运营商 3为代理 4为渠道商  5为商户  6为会员）',
  `file_path` varchar(1000) DEFAULT NULL,
  `status` int(11) DEFAULT NULL COMMENT '公告状态（0-关闭；1-开启）',
  `create_time` datetime DEFAULT NULL,
  `create_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8;

/*Data for the table `sys_notice_info` */

/*Table structure for table `sys_notice_info_file` */

DROP TABLE IF EXISTS `sys_notice_info_file`;

CREATE TABLE `sys_notice_info_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `notice_info_id` int(11) DEFAULT NULL COMMENT '公告详情主键（一对多）',
  `file_name` varchar(255) DEFAULT NULL COMMENT '文件名称',
  `file_path` varchar(255) DEFAULT NULL COMMENT '文件地址',
  `status` int(11) DEFAULT NULL COMMENT '文件状态',
  `param1` varchar(255) DEFAULT NULL COMMENT '备用字段',
  `create_time` datetime DEFAULT NULL,
  `create_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sys_notice_info_file` */

/*Table structure for table `sys_notice_users_relation` */

DROP TABLE IF EXISTS `sys_notice_users_relation`;

CREATE TABLE `sys_notice_users_relation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `notice_id` int(11) DEFAULT NULL COMMENT '公告信息表id',
  `readers_id` varchar(10000) DEFAULT NULL COMMENT '可以读这条公告的id',
  `create_time` datetime DEFAULT NULL,
  `create_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=utf8;

/*Data for the table `sys_notice_users_relation` */

/*Table structure for table `sys_options` */

DROP TABLE IF EXISTS `sys_options`;

CREATE TABLE `sys_options` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `option_name` varchar(100) DEFAULT NULL,
  `group_name` varchar(100) DEFAULT NULL COMMENT '分组名',
  `option_value` varchar(100) DEFAULT NULL,
  `option_lable` varchar(200) DEFAULT NULL COMMENT '状态值描述',
  `option_lable_en` varchar(200) DEFAULT NULL COMMENT '状态值的英文描述',
  `serial_num` int(11) DEFAULT NULL COMMENT '序号作为优先级排序的参考,0的优先级最高',
  `is_delete` int(5) NOT NULL DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id`),
  KEY `ix_option_name` (`option_name`) USING BTREE,
  KEY `ix_option_value` (`option_value`) USING BTREE,
  KEY `ix_option_exp` (`option_lable_en`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=309 DEFAULT CHARSET=utf8;

