/*Table structure for table `sys_temp` */

DROP TABLE IF EXISTS `sys_temp`;

CREATE TABLE `sys_temp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) DEFAULT NULL COMMENT '公司id',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `temp_name` varchar(250) DEFAULT NULL COMMENT '模板名称',
  `picture_path` varchar(250) DEFAULT NULL COMMENT '模板图片',
  `temp_type` int(1) DEFAULT '1' COMMENT '类型 1官网 2商城',
  `user_type` int(1) DEFAULT '1' COMMENT '用户类型 1系统 2用户',
  `is_delete` int(1) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_st_id` (`is_delete`) USING BTREE,
  KEY `ix_st_si` (`store_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=217 DEFAULT CHARSET=utf8 COMMENT='装修模板';

