/*Table structure for table `sys_user_info` */

DROP TABLE IF EXISTS `sys_user_info`;

CREATE TABLE `sys_user_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '系统用户的ID',
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户名',
  `real_name` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `is_fixed` int(5) DEFAULT '0' COMMENT '1是固定的，不可删除',
  `user_level` int(5) DEFAULT NULL COMMENT '用户级别（1誉道   2为运营商 3为代理 4为渠道商  5为商户  6为会员）',
  `user_type` int(5) DEFAULT NULL COMMENT '用户类型（1为主用户，2为客服）',
  `role_id` varchar(50) DEFAULT NULL COMMENT '用户角色',
  `password` varchar(100) DEFAULT NULL COMMENT '密码',
  `age` int(5) DEFAULT NULL COMMENT '年龄',
  `sex` int(5) DEFAULT NULL COMMENT '性别(1男， 2女， 3未知)',
  `identity_card` varchar(16) DEFAULT NULL COMMENT '身份证',
  `email` varchar(50) DEFAULT NULL COMMENT '邮件',
  `last_login_ip` varchar(50) DEFAULT NULL COMMENT '登录id',
  `note` varchar(200) DEFAULT NULL COMMENT '备注',
  `proprietor` varchar(200) DEFAULT NULL COMMENT '归属人',
  `can_audit` int(5) DEFAULT '1' COMMENT '是否需要上级之上的人审核(1为需要，2为不需要)',
  `is_oper_by_super` int(11) DEFAULT '1' COMMENT '操作人的id',
  `cooperation_begain_time` datetime DEFAULT NULL COMMENT '合作开始时间',
  `cooperation_end_time` datetime DEFAULT NULL COMMENT '合作结束时间',
  `cooperation_level` varchar(200) DEFAULT NULL COMMENT '合作级别',
  `company_name` varchar(255) DEFAULT NULL COMMENT '公司名字',
  `src` varchar(255) DEFAULT NULL COMMENT '来源（1为后台系统，2为网络来源）',
  `phone_no` varchar(50) DEFAULT NULL COMMENT '电话号码',
  `province` varchar(255) DEFAULT NULL COMMENT '省份',
  `city` varchar(255) DEFAULT NULL COMMENT '城市',
  `area` varchar(255) DEFAULT NULL COMMENT '区域',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `status` int(5) DEFAULT NULL COMMENT '状态（1为初始，2为等待审核，3启用，4驳回 ，5关闭，6为注销）',
  `logo` varchar(500) DEFAULT NULL COMMENT '用户登陆后的logo图',
  `is_delete` int(1) DEFAULT '0' COMMENT '1删除 0正常',
  `create_time` datetime DEFAULT NULL,
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  `last_update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  `overdue` int(1) DEFAULT '0' COMMENT '默认为空，null和0为不过期，1为过期 ',
  PRIMARY KEY (`id`),
  KEY `ix_sui_id` (`is_delete`) USING BTREE,
  KEY `ix_sui_un` (`user_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=172 DEFAULT CHARSET=utf8 COMMENT='后台用户';

/*Data for the table `sys_user_info` */

