/*Table structure for table `sys_wx_members` */

DROP TABLE IF EXISTS `sys_wx_members`;

CREATE TABLE `sys_wx_members` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL,
  `is_auth` int(11) DEFAULT '0' COMMENT '是否是认证用户  0为未认证，1为认证',
  `phone_no` varchar(50) DEFAULT NULL COMMENT '电话号码',
  `app_id` varchar(255) DEFAULT NULL COMMENT '平台的appId,用户区分是那个平台的用户',
  `open_id` varchar(255) DEFAULT NULL COMMENT '用户在平台的唯一标识',
  `nick_name` varchar(500) DEFAULT NULL COMMENT '用户的昵称',
  `gender` varchar(255) DEFAULT NULL COMMENT '性别',
  `city` varchar(255) DEFAULT NULL COMMENT '城市（微信信息）',
  `province` varchar(255) DEFAULT NULL COMMENT '省份（微信信息）',
  `country` varchar(255) DEFAULT NULL COMMENT '国家（微信信息）',
  `avatar_url` varchar(500) DEFAULT NULL COMMENT '头像（微信信息）',
  `union_id` varchar(500) DEFAULT NULL COMMENT '所有平台的联合标识',
  `e_mail` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `birth_date` date DEFAULT NULL COMMENT '出生日期',
  `entrance_type` int(1) DEFAULT '0' COMMENT '入口 0微官网 1微商城',
  `is_delete` int(255) DEFAULT '0' COMMENT '1为删除',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建人',
  `last_update_by` varchar(255) DEFAULT NULL COMMENT '最近一次更新人',
  `last_update_time` datetime DEFAULT NULL COMMENT '最近一次更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ix_sm_openId` (`open_id`) USING BTREE,
  KEY `ix_sm_appId` (`app_id`) USING BTREE
