/*Table structure for table `sys_wx_pay` */

DROP TABLE IF EXISTS `sys_wx_pay`;

CREATE TABLE `sys_wx_pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `good_type` varchar(50) DEFAULT NULL,
  `good_id` int(11) DEFAULT NULL,
  `mch_id` varchar(200) DEFAULT NULL,
  `app_id` varchar(200) DEFAULT NULL,
  `open_id` varchar(500) DEFAULT NULL,
  `pay_status` varchar(255) DEFAULT NULL,
  `body` varchar(500) DEFAULT NULL,
  `totalFee` int(11) DEFAULT NULL,
  `payment_time` datetime DEFAULT NULL,
  `user_agent` varchar(500) DEFAULT NULL,
  `transaction_id` varchar(11) DEFAULT NULL,
  `bank_type` varchar(500) DEFAULT NULL,
  `is_delete` int(3) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=444 DEFAULT CHARSET=utf8;

/*Data for the table `sys_wx_pay` */

/*Table structure for table `web_company` */

DROP TABLE IF EXISTS `web_company`;

CREATE TABLE `web_company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `shop_name` varchar(100) DEFAULT NULL COMMENT '主店名称',
  `shop_contact` varchar(100) DEFAULT NULL COMMENT '主店联系人名称',
  `shop_logo` varchar(250) DEFAULT NULL COMMENT '主店logo',
  `shop_province` varchar(100) DEFAULT NULL COMMENT '主店省份',
  `shop_city` varchar(100) DEFAULT NULL COMMENT '主店城市',
  `shop_area` varchar(100) DEFAULT NULL COMMENT '主店所在区',
  `shop_address` varchar(500) DEFAULT NULL COMMENT '主店详细地址',
  `company_name` varchar(100) DEFAULT NULL COMMENT '公司名称',
  `company_phone` varchar(15) DEFAULT NULL COMMENT '公司电话',
  `company_url` varchar(100) DEFAULT NULL COMMENT '公司域名',
  `company_contact` varchar(50) DEFAULT NULL COMMENT '公司联系人名称',
  `company_logo` varchar(250) DEFAULT NULL COMMENT '公司logo',
  `company_banner` varchar(1000) DEFAULT NULL COMMENT '公司banner图',
  `company_describe` longtext COMMENT '公司描述',
  `company_province` varchar(20) DEFAULT NULL COMMENT '省份',
  `company_city` varchar(20) DEFAULT NULL COMMENT '城市',
  `company_area` varchar(20) DEFAULT NULL COMMENT '区',
  `company_address` varchar(500) DEFAULT NULL COMMENT '公司详细地址',
  `is_delete` int(3) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_wc_id` (`is_delete`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8 COMMENT='微官网-公司（主店）信息';

