/group1/M00/00/19/rBEACVoS4QOAFL2kAALEPXLeXWo426.png','http://115.159.75.46:8888/group1/M00/00/19/rBEACVoS3UaAC1jAAAESRAsKLRY044.jpg,http://115.159.75.46:8888/group1/M00/00/19/rBEACVoS3UqAR9KyAADnL0JwdJA285.jpg,http://115.159.75.46:8888/group1/M00/00/19/rBEACVoS3VGAKkinAAEppv0PS9o357.jpg','<p>浙江开元萧山宾馆位于地铁2号线人民路站A2出口，沪杭甬高速公路近在咫尺，距杭州乐园、烂苹果乐园、极地海洋公园及湘湖景区仅10分钟左右车程，至西湖风景区约30分钟车程，距G20峰会国博中心15分钟。酒店系开元酒店集团旗下首家酒店，全国百优星级饭店，曾连续六年荣膺“浙江省最佳星级饭店”，近年来，又连续三年获评“杭州市十佳星级饭店”，首届杭州市最佳星级饭店。2016年G20杭州峰会境外媒体指定接待酒店。酒店客房及套房高雅、宽适，每间客房均精心设计布置。酒店还设有无烟客房和商务楼层，以满足商务客人的特别需求。酒店的餐饮极具特色和魅力，引领当地美食风尚。为中国餐饮名店、中华餐饮名店、国家五钻级酒家“三冠王”。酒店拥有餐位1500余座。在装潢精致的各个餐厅中，你可以享受精美膳食。景都、牡丹厅包厢群供应高档海鲜以及粤菜、本地菜等精品菜肴;锦香苑休闲餐厅提供各地风味。在新三角咖啡厅享用丰盛的西餐，你将能从中领略异国风情与风味。<br></p>','浙江省','杭州市','滨江区','中控集成大厦',0,46,'天书测试账号','2017-11-20 17:07:14',46,'2017-11-20 23:40:12',1,1,'天书测试账号'),(62,46,'誉道科技','官网','http://115.159.75.46:8888/group1/M00/00/1A/rBEACVoT8b-AMxIVAAG9e5q0kWw241.png','浙江省','杭州市','滨江区','中控集成大厦','誉道科技','17602145020','www.yudao365.com','天书','http://115.159.75.46:8888/group1/M00/00/1B/rBEACVoUL4GAWtI_ACgK-PQ0ehg148.png','http://115.159.75.46:8888/group1/M00/00/1B/rBEACVoUL7OAV8uYAAEyBzqnSsc456.jpg,http://115.159.75.46:8888/group1/M00/00/1B/rBEACVoUL7iACfIIAAHVp2MNeVY590.jpg','<p><img src=\"http://115.159.75.46:8888/group1/M00/00/1B/rBEACVoUMWmASm6NAAWkJGnlPnc971.jpg\" style=\"max-width:100%;\"><br></p>','浙江省','杭州市','滨江区','中控集成大厦',0,46,'天书测试账号','2017-11-21 15:57:56',46,'2017-11-21 22:00:33',1,1,'天书测试账号'),(65,46,'撒蛋糕','阿斯顿个饭','http://115.159.75.46:8888/group1/M00/00/1B/rBEACVoU8baAXygyAAAEf--IjSc297.jpg','浙江省','杭州市','滨江区','直',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,46,'天书测试账号','2017-11-22 11:40:52',NULL,NULL,1,NULL,NULL),(68,46,'誉道模版','模版','','浙江省','杭州市','滨江区','中控集成大厦',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,46,'天书测试账号','2017-11-24 10:52:40',46,'2017-12-11 09:58:59',1,1,'天书测试账号'),(87,46,'爱上莫','帅哥美女','http://115.159.75.46:8888/group1/M00/00/2A/rBEACVomSK2AIeiFAAJ2t2T5g2U292.jpg','北京市','北京市市辖区','东城区','南天'