  KEY `ix_wcsh_ci` (`company_id`) USING BTREE,
  KEY `ix_wcsh_mi` (`member_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=66 DEFAULT CHARSET=utf8 COMMENT='公司分享记录';

