/*Table structure for table `web_company_store` */

DROP TABLE IF EXISTS `web_company_store`;

CREATE TABLE `web_company_store` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `company_id` int(11) DEFAULT NULL COMMENT '公司id',
  `store_name` varchar(100) DEFAULT NULL COMMENT '店铺名称',
  `store_phone` varchar(15) DEFAULT NULL COMMENT '店铺电话',
  `store_logo` varchar(500) DEFAULT NULL COMMENT '店铺logo',
  `store_contact` varchar(50) DEFAULT NULL COMMENT '店铺联系人名称',
  `store_banner` varchar(1000) DEFAULT NULL COMMENT '店铺banner图',
  `store_describe` varchar(2000) DEFAULT NULL COMMENT '店铺描述',
  `store_province` varchar(20) DEFAULT NULL COMMENT '省份',
  `store_city` varchar(20) DEFAULT NULL COMMENT '城市',
  `store_area` varchar(20) DEFAULT NULL COMMENT '区',
  `store_address` varchar(500) DEFAULT NULL COMMENT '店铺详细地址',
  `store_status` varchar(500) DEFAULT '0' COMMENT '店铺状态 0关闭 1开启 2冻结',
  `is_delete` int(3) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_wcs_id` (`is_delete`) USING BTREE,
  KEY `ix_wcs_ci` (`company_id`) USING BTREE,
  KEY `ix_wcs_ui` (`user_id`) USING BTREE
