insert  into `web_company_store`(`id`,`user_id`,`company_id`,`store_name`,`store_phone`,`store_logo`,`store_contact`,`store_banner`,`store_describe`,`store_province`,`store_city`,`store_area`,`store_address`,`store_status`,`is_delete`,`create_by`,`create_name`,`create_time`,`last_update_by`,`last_update_time`,`create_user_type`,`update_user_type`,`last_update_name`) values (21,46,57,'美甲美睫','13782764738','http://115.159.75.46:8888/group1/M00/00/16/rBEACVoSSlaAM3r2AALCQLuI88k478.png','天书','http://115.159.75.46:8888/group1/M00/00/16/rBEACVoSS-uAY2XXAALj1wMpDJI372.jpg,http://115.159.75.46:8888/group1/M00/00/16/rBEACVoSS-6AJFfQAAOAIFzYG1w949.jpg,http://115.159.75.46:8888/group1/M00/00/16/rBEACVoSS_GAZn58AANvYFMV4oo583.jpg','<p>新店开业特惠活动进行中~<br>本店使用的纳米科技环保甲油胶，180色超多色系供团购客人选择。<br>特殊的钻石光泽超亮封层，持久Bulingbuling效果能维持四周以上。&nbsp;<br>我们独/家使用的进口持久环保底胶，卸甲不伤甲，卸甲之后在甲面形成一层保护膜，指甲不会变软变薄，常换颜色也不伤手哟<img src=\"//gss0.baidu.com/-4o3dSag_xI4khGko9WTAnF6hhy/bainuo/crop%3D0%2C0%2C1616%2C1080%3Bw%3D690%3Bq%3D90%3Bc%3Dnuomi%2C95%2C95/sign=783221ccb9096b63955604103103ab74/0d338744ebf81a4c237b0a2ad02a6059242da68c.jpg\" style=\"max-width: 100%;\"><img src=\"//gss0.baidu.com/-4o3dSag_xI4khGko9WTAnF6hhy/bainuo/crop%3D0%2C0%2C1616%2C1080%3Bw%3D690%3Bq%3D90%3Bc%3Dnuomi%2C95%2C95/sign=3d52f8e08044ebf8793e3e7fe4c9fb1a/d8f9d72a6059252d8218dce7339b033b5ab5b9c2.jpg\" style=\"max-width: 100%;\"><img src=\"//gss0.baidu.com/-4o3dSag_xI4khGko9WTAnF6hhy/bainuo/crop%3D0%2C0%2C1616%2C1080%3Bw%3D690%3Bq%3D90%3Bc%3Dnuomi%2C95%2C95/sign=58a202d0748da9775a60dc6b8d61d429/b151f8198618367ac886be3e29738bd4b21ce5c2.jpg\" style=\"max-width: 100%;\"><br></p>','浙江省','杭州市','滨江区','中控集成大厦','1',0,46,'天书测试账号','2017-11-20 11:31:31',46,'2017-12-09 15:18:51',1,1,'天书测试账号'),(24,46,59,'维也纳酒店','13787283746','http://115.159.75.46:8888/group1/M00/00/19/rBEACVoS4RaAAOgoAALEPXLeXWo534.png','天书','http://115.159.75.46:8888/group1/M00/00/19/rBEACVoS236AWqNFAADnL0JwdJA757.jpg,http://115.159.75.46:8888/group1/M00/00/19/rBEACVoS24OAHpZjAAESRAsKLRY783.jpg','<p>浙江开元萧山宾馆位于地铁2号线人民路站A2出口，沪杭甬高速公路近在咫尺，距杭州乐园、烂苹果乐园、极地海洋公园及湘湖景区仅10分钟左右车程，至西湖风景区约30分钟车程，距G20峰会国博中心15分钟。酒店系开元酒店集团旗下首家酒店，全国百优星级饭店，曾连续六年荣膺“浙江省最佳星级饭店”，近年来，又连续三年获评“杭州市十佳星级饭店”，首届杭州市最佳星级饭店。2016年G20杭州峰会境外媒体指定接待酒店。酒店客房及套房高雅、宽适，每间客房均精心设计布置。酒店还设有无烟客房和商务楼层，以满足商务客人的特别需求。酒店的餐饮极具特色和魅力，引领当地美食风尚。为中国餐饮名店、中华餐饮名店、国家五钻级酒家“三冠王”。酒店拥有餐位1500余座。在装潢精致的各个餐厅中，你可以享受精美膳食。景都、牡丹厅包厢群供应高档海鲜以及粤菜、本地菜等精品菜肴;锦香苑休闲餐厅提供各地风味。在新三角咖啡厅享用丰盛的西餐，你将能从中领略异国风情与风味。<br></p>','浙江省','杭州市','滨江区','中控集成大楼','0',0,46,'天书测试账号','2017-11-20 21:42:34',46,'2017-11-20 22:05:13',1,1,'天书测试账号'),(25,46,62,'誉道科技','17602135020','http://115.159.75.46:8888/group1/M00/00/1A/rBEACVoT-YiAI0dUACgK-PQ0ehg005.png','天书','http://115.159.75.46:8888/group1/M00/00/1A/rBEACVoT-dyABp5JAAEyBzqnSsc819.jpg,http://115.159.75.46:8888/group1/M00/00/1A/rBEACVoT-eGAJ55DAAHVp2MNeVY819.jpg,http://115.159.75.46:8888/group1/M00/00/1A/rBEACVoT-euAQawiAAWkJGnlPnc647.jpg','<p><img src=\"http://115.159.75.46:8888/group1/M00/00/1A/rBEACVoT-euAQawiAAWkJGnlPnc647.jpg\" style=\"max-width:100%;\"><br></p>','浙江省','杭州市','滨江区','中控集成大厦','0',0,46,'天书测试账号','2017-11-21 18:03:50',46,'2017-11-21 22:02:11',1,1,'天书测试账号'),(26,46,65,'呃我噶','呃我噶','http://115.159.75.46:8888/group1/M00/00/1B/rBEACVoU8dSAHaR7AAAFIHEzCZI661.jpg','围观','http://115.159.75.46:8888/group1/M00/00/1B/rBEACVoU8diAKSspAAG_Qs3WRcI760.jpg','<p>24她</p>','浙江省','杭州市','滨江区','中控集成大厦','0',0,46,'天书测试账号','2017-11-22 11:41:28',NULL,NULL,1,NULL,NULL),(32,46,68,'誉道科技','13701239484','http://115.159.75.46:8888/group1/M00/00/1D/rBEACVoXjn6AaN9eAABBaCT_7-Q011.png','天书','http://115.159.75.46:8888/group1/M00/00/1D/rBEACVoXjoOAPVWPAABBaCT_7-Q651.png','<p>时代的</p>','浙江省','杭州市','滨江区','中控集成大厦','0',0,46,'天书测试账号','2017-11-24 11:14:29',NULL,NULL,1,NULL,NULL),(41,170,96,'测试','13917674303','http://www.ydxcx.net/group1/M00/00/2F/rBEACVowz86ATvb0AABy65bnSXQ470.png','王','http://www.ydxcx.net/group1/M00/00/2F/rBEACVowz9GAY05CAABT7T5UG-s811.png','<p>大哥大</p>','四川省','成都市','温江区','涌泉东','0',0,170,'商户','2017-12-13 15:00:18',NULL,NULL,1,NULL,NULL),(42,1