DROP TABLE IF EXISTS `web_company_visit_his`;

CREATE TABLE `web_company_visit_his` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) DEFAULT NULL COMMENT '公司id',
  `member_id` int(11) DEFAULT NULL COMMENT '会员id',
  `store_id` int(11) DEFAULT NULL COMMENT '门店id',
  `ip_address` varchar(11) DEFAULT NULL COMMENT 'IP地址',
  `visit_date` varchar(10) DEFAULT NULL COMMENT '访问日期',
  `visit_time` datetime DEFAULT NULL COMMENT '访问时间',
  PRIMARY KEY (`id`),
  KEY `ix_wcvh_ci` (`company_id`) USING BTREE,
  KEY `ix_wcvh_mi` (`member_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=715 DEFAULT CHARSET=utf8 COMMENT='公司访问记录';

