CREATE TABLE `web_cust_server_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT '人员id',
  `wx_account` varchar(255) DEFAULT NULL COMMENT '微信账户',
