DROP TABLE IF EXISTS `web_deco_navi_content_temp`;

CREATE TABLE `web_deco_navi_content_temp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `component_id` int(11) DEFAULT NULL COMMENT '页内导航id',
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `picture_path` varchar(250) DEFAULT NULL COMMENT '图片路径',
  `list_style` int(1) DEFAULT NULL COMMENT '产品列表样式 1列表 2九宫格',
