/*Table structure for table `web_deco_page_content_temp` */

DROP TABLE IF EXISTS `web_deco_page_content_temp`;

CREATE TABLE `web_deco_page_content_temp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `component_id` int(11) DEFAULT NULL COMMENT '页面内容id',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `list_style` int(1) DEFAULT NULL COMMENT '产品列表样式 1列表 2九宫格',
  `link_content` int(1) DEFAULT NULL COMMENT '连接内容 1 单产品详情 2多产品列表',
  `link_type` int(1) DEFAULT NULL COMMENT '连接类型 1产品 2文章 3公司介绍',
  `list_id` int(11) DEFAULT NULL COMMENT '列表id',
  `picture_path` varchar(250) DEFAULT NULL COMMENT '图片',
  `is_delete` int(1) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_wdpct_id` (`is_delete`) USING BTREE,
  KEY `ix_wdpct_si` (`store_id`) USING BTREE,
  KEY `ix_wdpct_ci` (`component_id`) USING BTREE
