/*Table structure for table `web_deco_slider_temp` */

DROP TABLE IF EXISTS `web_deco_slider_temp`;

CREATE TABLE `web_deco_slider_temp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `show_type` int(1) DEFAULT NULL COMMENT '展示方式',
