/*Table structure for table `web_orders` */

DROP TABLE IF EXISTS `web_orders`;

CREATE TABLE `web_orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) DEFAULT NULL COMMENT '公司id',
  `store_id` int(11) DEFAULT NULL COMMENT '门店id',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `product_id` int(11) DEFAULT NULL COMMENT '产品id',
  `product_type` int(1) DEFAULT NULL COMMENT '产品类型 1文章 2产品',
  `product_name` varchar(250) DEFAULT NULL COMMENT '产品名称',
  `product_desc` varchar(500) DEFAULT NULL COMMENT '产品描述',
  `product_picture` varchar(500) DEFAULT NULL COMMENT '产品图片',
  `orders_number` varchar(32) DEFAULT NULL COMMENT '预约订单流水号',
  `store_phone` varchar(20) DEFAULT NULL COMMENT '电话号码',
  `store_name` varchar(32) DEFAULT NULL COMMENT '门店名称',
  `store_address` varchar(20) DEFAULT NULL COMMENT '门店地址',
  `book_name` varchar(32) DEFAULT NULL COMMENT '预约人名称',
  `book_phone` varchar(20) DEFAULT NULL COMMENT '预约人电话',
  `note` varchar(1000) DEFAULT NULL COMMENT '订单备注',
  `order_status` int(2) DEFAULT NULL COMMENT '订单状态 1待确认 2已确认 3用户取消 4商家取消',
