insert  into `web_store_manager_article`(`id`,`company_id`,`title`,`author`,`content`,`cover`,`sort`,`summary`,`is_delete`,`create_by`,`create_name`,`create_time`,`last_update_by`,`last_update_name`,`last_update_time`,`create_user_type`,`update_user_type`) values (193,59,'提升逼格的的星级酒店冷知识','酒店','<div id=\"2006_2\">四个枕头真的有必要吗？</div><div id=\"2006_3\">必须有！这其实是酒店贴心人性化的服务，因为不同客人对枕头的高低、软硬都有不同要求，所以备上几个大小不一、不同材质的枕头就可以满足不同人的需要。而且从健康考虑，还可以在腰部、膝下、背后垫上枕头，满足不同的起居需要，也更为舒适。</div><div id=\"2006_4\">酒店客房里的4个枕头，根据睡姿，可以起到不同的作用。 仰卧时可以将一个枕头放在头和脖子下面用来做真正的枕头，枕头要刚好从整个头部一直垫到脖子。另一个枕头则放在两膝下，使膝关节能够处于轻度屈曲放松状态。如果侧卧，肩部的宽度会导致头颈部悬空，如果枕头较低，可以将两个枕头叠在一起枕，两膝间最好也要夹个小枕头，这样会感觉非常舒服。</div><div id=\"2006_5\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-fo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/9d82d158ccbf6c81867a822ab53eb13532fa40a6.jpg\"></div><div></div><div id=\"2006_7\">酒店的完美隔音是如何做到的？</div><div id=\"2006_8\">对于一个睡觉容易惊醒的人来说，深夜走廊的脚步声、隔壁房间的噪音，都是影响睡眠质量的重要因素。大多酒店都位于繁华的地段，噪音都非常大，而酒店都是需要一个安静舒适的空间，因此做好酒店隔音也是非常重要的。酒店的隔音主要可分为以下几大部分：</div><div id=\"2006_9\">1.门窗的隔音，外界噪音大多会通过门窗而传播，因此做好门窗的隔音十分重要，可采用专业的隔音门与隔音窗进行安装。门窗的缝隙需要用密封条做好密封处理。</div><div id=\"2006_10\">2.墙体的隔音，室内隔音工程中最重要的一部分，一般楼房的承重墙用钢盘混凝土或实心砖的结构，有较好的隔音效果。墙的隔声量与它的厚度及表面处理有关。泄漏声音的缝隙和孔洞对房间的隔声也有影响，特别对中频部分的隔声量影响较大，因此在施工过程中必须做好密封。目前隔音效果较好的材料有阻尼隔音毡与阻尼隔音板，采用这两种材料搭配使用隔音效果最佳。</div><div id=\"2006_11\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-fo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/71cf3bc79f3df8dccf7a2153c411728b461028a8.jpg\"></div><div></div><div id=\"2006_13\">行政楼层为什么额外贵？</div><div id=\"2006_14\">行政楼层被称为“店中店”，是80年代匹兹堡Hyatt发明的，就是在普通房间的基础上附加价格提供额外服务。它更像是一种房间等级，所占的比例取决于酒店豪华程度，酒店越豪华，所设的行政楼层客房数量也就越多。</div><div id=\"2006_15\">当然“天下没有白吃的午餐”，行政楼层的房价会比一般楼层高出 20% 至 50%，但你能享受更多的服务。除了快速入住登记、免费洗熨衣、免费软饮提供等服务，吃货们还可以享受到一天中最重要的时光 happy hour（晚餐时刻鸡尾酒及小吃）！</div><div id=\"2006_16\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-4o3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/dbb44aed2e738bd4df051bf3a88b87d6267ff9c8.jpg\"></div><div></div><div id=\"2006_18\">了解这些小姿势，下次再去嘿嘿嘿的时候又有新故事让妹子肃然起敬了！</div>','http://www.ydxcx.net/group1/M00/00/17/rBEACVoSnv-AA7QMAACP-MyVR7I018.jpg',1,'了解这些小姿势，下次再去嘿嘿嘿的时候又有新故事让妹子肃然起敬了！',0,46,'天书测试账号','2017-11-20 17:24:29',NULL,NULL,'2017-11-20 17:24:29',1,NULL),(194,59,'有哪些知名国际品牌酒店','酒店','<div id=\"1957_1\">有哪些知名国际品牌酒店</div><div></div><div id=\"1957_2\">英国巴斯Bass/洲际Wikipedia国际连锁酒店集团</div><div></div><div id=\"1957_5\">巴斯(Bass)酒店管理集团成立于1777年，是全球排名位居前列的国际酒店管理集团，在全球近100个国家和地区共有3520家连锁酒店，超过53万间客房，如果按酒店的分布区域测算，为全球第一。</div><div id=\"1957_7\">洲际集团是目前全球最大及网络分布最广的专业酒店管理集团，拥有洲际、皇冠假日、假日酒店等多个国际知名酒店品牌和超过60年国际酒店管理经验。同时洲际酒店集团也是世界上客房拥有量最大（高达650,000间）、跨国经营范围最广，分布将近100个国家，并且在中国接管酒店最多的超级酒店集团。包括中国大陆25个省、区、市。</div><div id=\"1957_6\">“洲际”旗下的酒店品牌有洲际酒店及度假村（InterContinental Hotels &amp; Resorts），假日酒店及假日度假酒店（Holiday Inn），皇冠假日酒店（Crowne Plaza Hotels），智选假日酒店（Holiday Inn Express），英迪格酒店(Indigo) 。</div><div></div><div id=\"1957_8\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-4o3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/35a85edf8db1cb137d636bc4d454564e93584bda.jpg\"></div><div></div><div id=\"1957_12\">法国雅高ACCOR集团</div><div></div><div id=\"1957_14\">法国雅高ACCOR集团在欧洲处于业界主导地位，在世界140个国家有145,000名雇员,是全球最大的酒店、旅游集团。旗下分布于90个国家的3,700家酒店(共410,000间客房)、旅行社，包括从豪华到经济各档次10余个品牌，索菲特酒店SOFITEL、诺富特酒店NOVOTEL、MERCURE、IBIS，此外像FORMULE 1、RED ROOF INNS、CORALIA、MOTEL 6等品牌。</div><div></div><div id=\"1957_16\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-4o3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/4b90f603738da977a5d3d1fcb951f8198718e36d.jpg\" class=\"\"></div><div></div><div id=\"1957_17\">希尔顿HILTON FAMILY酒店集团</div><div></div><div id=\"1957_19\">国际希尔顿HILTON INTERNATIONAL及希尔顿酒店集团HILTON HOTELS CORPORATION于1997年一月合作联盟协议，在世界55个国家经营超过2100家连锁酒店，旗下品牌主要包括：国际港丽酒店CONRAD、希尔顿大饭店HILTON、双树大饭店DOUBLE TREE、大使套房酒店EMBASSY SUITE、家木套房酒店HOMEWOOD SUITE、哈里逊会议中心HARRISON CONFERENCE CENTER、庭园旅馆GARDEN INN、汉普顿旅馆HAMPTON INN AND SUITES、希尔顿渡假俱乐部HILTON GRAND VACATIONS CLUB。</div><div></div><div id=\"1957_21\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/94o3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/503d269759ee3d6d9d89d11c4a166d224e4ade9e.jpg\"></div><div></div><div id=\"1957_23\">喜达屋STARWOOD酒店管理集团</div><div></div><div id=\"1957_26\">世界著名的酒店管理集团——喜达屋STARWOOD饭店及度假村集团，在超过80个国家拥有、管理或特许经营着超过750家酒店。拥有威斯汀WESTIN、喜来登SHERATON、福朋FOUR POINTS、圣瑞吉斯ST.REGIS、至尊精选THE LUXURY COLLECTION、W HOTEL等酒店品牌。</div><div></div><div id=\"1957_28\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-fo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/48540923dd54564ea4beb5eebade9c82d0584f09.jpg\" class=\"\"></div><div></div><div id=\"1957_30\">香格里拉SHANGRI-LA酒店集团</div><div></div><div id=\"1957_32\">香格里拉酒店管理集团总部设在香港，集团在亚洲主要城市及广受欢迎的度假地点都建有豪华酒店和度假村—共有37家酒店(19000余间客房)，24000余名员工遍布于亚太地区。成立于1989年的商贸饭店 TRADER是香格里拉集团的另一重要品牌。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;总部位于香港的国际豪华酒店运营集团，是世界著名的三大豪华酒店集团之一，在11个国家的主要国际城市和渡假胜地拥有18家酒店。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;亚洲酒店联盟ASIA HOTELS ALLIANCE由台湾丽致LANDIS、泰国杜狮DUSIT、香港马可波罗MARCO POLO、新加坡君华MERITUS及日本新欧塔尼NEW OTANI五大知名连锁酒店共创亚洲酒店联盟，成为亚太区第一个跨国酒店联盟，经营的酒店达70家，遍布亚洲50个国家。</div><div></div><div id=\"1957_34\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/7Po3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/8c1001e93901213fb7f11e0b5de736d12e2e9522.jpg\"></div>','http://www.ydxcx.net/group1/M00/00/17/rBEACVoSn8KAIeNZAAA_ueIqyLg924.jpg',3,'巴斯(Bass)酒店管理集团成立于1777年，是全球排名位居前列的国际酒店管理集团，在全球近100个',0,46,'天书测试账号','2017-11-20 17:26:29',46,'天书测试账号','2017-12-07 10:19:36',1,1),(195,59,'涨知识|酒店床旗有什么用？','酒店','<div id=\"1981_1\">涨知识|酒店床旗有什么用？</div><div></div><div id=\"1981_3\">住酒店时“床尾一条布”是干嘛的？不要笑，摸着良心说肯定不少人也有过这样的疑惑。</div><div></div><div id=\"1981_5\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-fo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/79f0f736afc379317c6cc9fee2c4b74542a911e4.jpg\"></div><div></div><div id=\"1981_7\">铺在床尾的叫床尾巾或者床尾毯，专业一点的名字叫床旗，英文是Bed Runner，下次，你就可以装作内部人士的样子，指着这条精美的布告诉别人：这货叫“床旗”！<br><br>&nbsp; &nbsp; &nbsp;&nbsp; 作用有三：<br><br>&nbsp; &nbsp; &nbsp;&nbsp; 一，作为一种整体搭配的装饰；<br><br>&nbsp; &nbsp; &nbsp;&nbsp; 二，防止灰尘，大家随意坐下时也可以避免将衣服上的污渍沾染到床单上；<br><br>&nbsp; &nbsp;&nbsp; &nbsp; 三，不同酒店品牌的床旗图案设计、材质都有所不同，甚至有大神可以从床旗判断出酒店品牌，这也侧面起到了宣传的效果。<br><br>&nbsp; &nbsp; &nbsp;&nbsp; 另外，说道起源，其实美国人真的是很喜欢穿鞋子上沙发或者床上，最开始应该是实用性为主的，垫个床尾毯可以把脚连鞋一同搭在上面，而床又不会脏。<br><br>&nbsp; &nbsp; &nbsp;&nbsp; 而且据说重一点的床旗还可以防止晚上被褥乱动，但是现在床旗已经成了装饰为主的，是一套完整的床上装饰中必不可少的部分，而且美国的床单大多很简单的纯色系，只有bed runner是会带绣花之类的丝质，一方面也比较容易改变卧室风格。<br></div><div></div><div id=\"1981_9\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/94o3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/5243fbf2b21193135030b6676c380cd790238df2.jpg\"></div>','http://www.ydxcx.net/group1/M00/00/17/rBEACVoSn_eAUg6_AABRG7sk8YM403.jpg',2,'住酒店时“床尾一条布”是干嘛的？不要笑，摸着良心说肯定不少人也有过这样的疑惑。',0,46,'天书测试账号','2017-11-20 17:27:30',46,'天书测试账号','2017-12-07 10:19:36',1,1),(196,59,'怎样住酒店才安全？','酒店','<div id=\"1975_1\">怎样住酒店才安全？</div><div></div><div id=\"1975_3\">一座上百间客房的酒店的安全漏洞，要远比你能想到的多很多。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 和颐酒店女生遇袭一事引发了人们对酒店安全的密切关注和深深的忧虑。作为一名资深旅客，“开房达人”、阅房无数，总结了酒店里面一些隐藏的安全设施和有关人身及财物安全的秘笈，一张小小房卡就有很多学问。</div><div></div><div id=\"1975_5\">房卡</div><div></div><div id=\"1975_7\">多数酒店现在都已经放弃机械钥匙，使用房卡开门。但是房卡的安全性其实非常差。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 首先，大部分酒店办理入住时会用一个房卡套装房卡，并写上房间号码甚至还附有酒店地址。一旦房卡遗失，犯罪分子就可以大摇大摆地直接进入房间。所以，入住酒店后第一时间应该将房卡套和房卡分离，或者将房间号抹去，防止房卡丢失带来的麻烦。</div><div></div><div id=\"1975_9\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/9vo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/9345d688d43f8794fd9b13f9db1b0ef41ad53a84.jpg\"></div><div></div><div id=\"1975_11\">这家酒店的房卡套背面直接就写着酒店名，还有地址和房号。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 第二，部分新装修的酒店逐渐开始接受跟apple pay一样用手机开房门，这种安全性要好很多，但是一定要给手机设密码，因为开门的APP同样会提示酒店地址和房号。</div><div></div><div id=\"1975_13\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/94o3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/9213b07eca806538fc56fec49edda144ac3482ad.jpg\"></div><div></div><div id=\"1975_15\">第三，许多酒店的电梯已经采用了门禁安全系统，住客需要刷房卡才能开启电梯到客房区。但不要因为有这种门禁系统就放松警惕。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 只有少部分酒店的电梯门禁系统，能够识别房卡对应的楼层，禁止客人到其他楼层；对多数酒店的电梯来说，和本次事发的和颐酒店一样，住店客人的房卡可以到任何楼层。即便酒店有电梯门禁系统，其提供的安全保障也很有限。例如只要有客人刷了房卡，其他伺机进入电梯的客人就可能随意选择楼层。而如果客人入住酒店后选择提前退房，其房卡的电梯功能不能被注销，用已经退房的房卡依然可以随便打开电梯。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 第四，注意保护客人的身份信息。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 这里谈一下客人遗失房卡后补房卡的流程。虽然严格来说上补房卡需要出示登记入住客人的身份证件原件，但有些酒店本着人性化服务的原则，在补房卡时只验证客人的几项关键的个人信息，例如姓名和身份证号、生日、手机号码或者信用卡号，就可以直接补房卡。因此住店期间要格外注意保护自己的个人信息。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 有些旅客入住酒店后，会把登机牌随手一扔，但殊不知有些机场的登机牌安全措施不足，直接把身份证号码和姓名就印在登机牌上，给犯罪分子可乘之机。</div><div></div><div id=\"1975_17\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/9vo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/b03533fa828ba61e912692f84834970a314e5918.jpg\"></div><div></div><div id=\"1975_19\">第五，补房卡也要讲学问。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 使用房卡的酒店，在补房卡时可以用两种不同的方式补房卡。一种是复制一张跟原房卡一样的信息，这时原房卡依然可以使用（行话称为duplicate）；另一种是直接刷新一张信息完全不同的房卡（new），同时注销之前遗失的房卡。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 如果确定房卡遗失，务必通知前台按照遗失方式补房卡，不要怕挂失房卡收费而因小失大；如今大部分高星级酒店的房卡也不再收遗失罚金。（悄悄告诉你好多老住酒店的人都收集房卡）</div><div></div><div id=\"1975_21\">客房内安全</div><div></div><div id=\"1975_23\">虽然没有必要每次入住酒店都要去看“紧急逃生路线图”，但是知道这张图在哪还是很有必要的——这张图基本上都会在房门的背面。同样，紧急逃生时使用的照明电棒，基本都会在床头柜下面，必要时要知道去哪里找。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 上面已经提到了房卡的种种不安全，但其实还忽略了一种可能，就是前台员工偶尔失误会把已经住了人的房间再分配给另外一个人（行话称为双卖，double sold），而且这种你正在洗澡时，别的客人打开房门一头雾水的概率其实还不低。所以进入房间最好使用房间的防盗链将房门反锁。</div><div></div><div id=\"1975_25\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-fo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/08f790529822720eca22a72d72cb0a46f31fab7d.jpg\"></div><div></div><div id=\"1975_27\">部分高级酒店的卫生间里面会有为如厕或洗澡时突发心脏病的客人设置一个红色紧急呼叫按钮，按照酒店的安全手册，一旦按下这个紧急按钮，酒店总机必须回拨电话确认安全；如回拨时无应答，酒店会视情况破门而入。所以这个紧急按钮，有的时候能救你一命！</div><div></div><div id=\"1975_29\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/7Po3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/314e251f95cad1c8983eb8f0763e6709c83d515b.jpg\"></div><div></div><div id=\"1975_31\">财物安全</div><div></div><div id=\"1975_33\">有些高级酒店房间内会有一个密码保险箱，保险箱大到甚至能放下笔记本电脑。但这种保险箱实际上只能防君子不能防小人，酒店礼宾部一般都会有个机器很轻松地为忘记密码的客人打开保险箱。如果酒店管理不善，实际上这个保险箱对酒店员工来说就是“皇帝的新衣”；而对技艺高超的盗贼，这种保险箱也不难攻破，所以对房间内保险箱里面财物的丢失，酒店往往不负责。</div><div></div><div id=\"1975_35\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/9vo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/2f738bd4b31c8701381cf6312e7f9e2f0608ffbb.jpg\"></div><div></div><div id=\"1975_37\">所以不在酒店房间时，应把十分贵重的财物交给前台，放在前台的保险箱里面保管；此时酒店也对放在保险箱里面的财物负责。</div><div></div><div id=\"1975_39\">公共区域安全</div><div></div><div id=\"1975_41\">国外许多身处闹市区、治安欠佳区域的酒店，往往会在晚间开启整栋的门禁。晚间只有正门可以进入酒店，同时需要刷房卡或者通过门禁语音系统请求前台开启门禁。在治安不佳的地方，应该尽量选择有这种门禁系统的酒店。</div><div></div><div id=\"1975_43\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/9fo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/8644ebf81a4c510f0b8ba5cd6959252dd52aa59e.jpg\"></div><div></div><div id=\"1975_45\">同时，从下车到酒店大堂这几步路往往是窃贼下手的最佳时间，可以选择将贵重财物交给酒店门童搬运，他们不仅有经验，而且会对财物安全负责。<br><br>&nbsp; &nbsp; &nbsp; &nbsp; 大堂是酒店人流最密集的地方，虽然有保安但是仍然有许多安全隐患。近年来有部分高端酒店选择将大堂设在非首层的其他楼层，甚至是顶层，客人换乘客房区电梯也是有安全考虑。</div><div></div><div id=\"1975_47\">总结</div><div></div><div id=\"1975_49\">整体来说，一座上百间客房的酒店的安全漏洞，要远比你能想到的多很多。所谓“君子不立危墙之下”，一方面尽量选择连锁品牌酒店减少安全隐患，但哪怕是连锁酒店的高端品牌也不能完全避免各种安全隐患。出门在外多分小心，家人少份牵挂。</div>','http://www.ydxcx.net/group1/M00/00/17/rBEACVoSoE-AB2CIAAAj9_8kQ_k362.jpg',5,'一座上百间客房的酒店的安全漏洞，要远比你能想到的多很多。和颐酒店女生遇袭一事引发了人们对酒店安全的',0,46,'天书测试账号','2017-11-20 17:29:05',46,'天书测试账号','2017-12-07 10:19:20',1,1),(197,59,'涨姿势?|中国古代有酒店吗？','酒店','<div id=\"1988_2\">涨姿势?|中国古代有酒店吗？</div><div></div><div id=\"1988_1\">中国古代的“酒店”盛产武松、鲁智深、张飞之类的酒中豪杰，但是跟现在的 Hotel 可不是一回事。</div><div></div><div id=\"1988_5\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/94o3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/0b55b319ebc4b74533c606c1c6fc1e178b821592.jpg\" class=\"w-e-selected\"></div><div></div><div id=\"1988_7\">酒店（Hotel）概念的确是西方舶来的，是非常现代的说法。不过若只是从居停意义上来看，中国一点也不落后——武侠小说里的龙门客栈，孙二娘的人肉主题客栈，难道不就是古代版的酒店吗？</div><div></div><div id=\"1988_9\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/-fo3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/d058ccbf6c81800a074b38d9b83533fa838b47be.jpg\"></div><div></div><div id=\"1988_11\">既然大大小小的古代客栈的确存在，那么问题来了，古代没有身份证，也没有“说走就走”的某订房平台，要想出门玩耍，可要怎么操作呢？</div><div></div><div id=\"1988_13\" component=\"image\" data-init=\"[]\"><img data-href=\"\" src=\"https://gss0.baidu.com/7Po3dSag_xI4khGko9WTAnF6hhy/lbsplace/pic/item/8ad4b31c8701a18b0029a398972f07082938fe23.jpg\"></div><div id=\"1988_15\">事实上，古代的户籍制度相当完善，不仅需要“身份证”，而且查得很紧，没有「介绍信」只能睡马路。古代的中国虽然无法信息化管理户口，但很早以前就有完整的户籍制度。为了证明和区分人与人之间的不同，古人发明了「路引」、「门券」抑或「鱼符」、「牙牌」之类证明身份的腰牌。不过有一点需要说明，古人的防伪技术是非常差的，因此经常出现假冒的身份证。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 大部分古代中国人很少有出远门的机会，只有少数人有这个需求。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 如果是官员、商人出差，或得到官方授权的外事活动，都会持有「符节」或「符卷」，这种「符」、「节」、「卷」等，都是早期入住旅馆的身份证明，这些相当于现代的「介绍信」。后来的「驿卷」、「信牌」也都属于旅行凭证。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 当然，在小说里出现的荒郊野岭的客栈，比如孙二娘开的人肉主题客栈、李凤姐开的美女主题客栈，理论上说，由于天高皇帝远，应该是不需要的。<br><br>&nbsp;&nbsp;&nbsp; 　至于品牌宣传，古代当然没有ＯＴＡ、没有连锁酒店直销渠道……主要靠口碑传播。古代旅馆早已充分考虑了硬件建设，让客人入住后更觉舒适，以增加客人来源。《上客舍议》称，「冬有温庐，夏有凉荫」，这里的「温庐」相当于现代配有暖气的房间，「凉荫」则是纳凉休闲去处。</div>','http://www.ydxcx.net/group1/M00/00/17/rBEACVoSoKCACXqmAABTKBK2jT0738.jpg',4,'中国古代的“酒店”盛产武松、鲁智深、张飞之类的酒中豪杰，但是跟现在的 Hotel 可不是一回事。',0,46,'天书测试账号','2017-11-20 17:30:10',46,'天书测试账号','2017-12-07 10:19:20',1,1),(248,87,'屌丝','撒地方','<p>几千万屌丝<br></p>','http://115.159.75.46:8888/group1/M00/00/2A/rBEACVomTEeADoLpAAJ2t2T5g2U589.jpg',1,'几千万屌丝',0,46,'天书测试账号','2017-12-05 15:35:40',46,'天书测试账号','2017-12-05 15:36:12',1,1),(249,57,'美甲','123','<p>美甲<br></p>','http://115.159.75.46:8888/group1/M00/00/2D/rBEACVormdqAfT7FAAJ2t2T5g2U004.jpg',1,'美甲',0,46,'天书测试账号','2017-12-09 16:07:59',NULL,NULL,NULL,1,NULL);

/*Table structure for table `web_store_manager_product` */

DROP TABLE IF EXISTS `web_store_manager_product`;

CREATE TABLE `web_store_manager_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) DEFAULT NULL COMMENT '公司id',
  `introduce` longtext COMMENT '详情介绍',
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `cover` varchar(500) DEFAULT NULL COMMENT '封面',
  `slider_path` varchar(1000) DEFAULT NULL COMMENT '轮播图',
  `sort` int(11) DEFAULT NULL,
  `description` varchar(1000) DEFAULT NULL COMMENT '描述',
  `is_book` int(1) DEFAULT '0' COMMENT '预约标志 默认0不预约  1预约  ',
  `is_delete` int(1) DEFAULT '0',
  `create_by` int(11) DEFAULT NULL,
  `create_name` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_update_by` int(11) DEFAULT NULL,
  `last_update_name` varchar(50) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `create_user_type` int(1) DEFAULT NULL,
  `update_user_type` int(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ix_wsmp_id` (`is_delete`) USING BTREE,
  KEY `ix_wsmp_si` (`company_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=166 DEFAULT CHARSET=utf8 COMMENT='店铺产品-商品';

