/* Function  structure for function  `getAllChildMallById` */

/*!50003 DROP FUNCTION IF EXISTS `getAllChildMallById` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getAllChildMallById`(`rootId` int) RETURNS varchar(2000) CHARSET utf8
BEGIN
	
  DECLARE sTemp VARCHAR(2000);
	DECLARE sTempChd VARCHAR(1000);
  DECLARE resultStr VARCHAR(2000);
  SET resultStr = '';
  SET sTemp = '';
  SET sTempChd =cast(rootId as CHAR);
  WHILE sTempChd is not null DO
   SET sTemp = concat(sTemp,',',sTempChd);
   SELECT group_concat(id) INTO sTempChd FROM sys_user_info sui  where FIND_IN_SET(sui.proprietor,sTempChd)>0 and sui.is_delete = 0;
  END WHILE;

 SELECT group_concat(id) INTO resultStr FROM sys_user_info WHERE  FIND_IN_SET(id,sTemp)>0 AND  user_level=5;

	RETURN resultStr;
END */$$
DELIMITER ;

/* Function  structure for function  `getNumOneTypeChildById` */

/*!50003 DROP FUNCTION IF EXISTS `getNumOneTypeChildById` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getNumOneTypeChildById`(`rootId` int,`level` int) RETURNS int(11)
BEGIN
	
  DECLARE sTemp VARCHAR(2000);
	DECLARE sTempChd VARCHAR(1000);
  DECLARE num INT;
  SET sTemp = '';
  SET sTempChd =cast(rootId as CHAR);
  SET num = 0;
  WHILE sTempChd is not null DO
   SET sTemp = concat(sTemp,',',sTempChd);
   SELECT group_concat(id) INTO sTempChd FROM sys_user_info sui  where FIND_IN_SET(sui.proprietor,sTempChd)>0 and sui.is_delete = 0;
  END WHILE;

 SELECT COUNT(id) INTO num FROM sys_user_info WHERE  FIND_IN_SET(id,sTemp)>0 AND  user_level=level;

	RETURN num;
END */$$
DELIMITER ;

