   SET sLevel2 = concat(sLevel2,',',sLevel);
   SET sTemp = concat(sTemp,',',sTempChd);
   SELECT group_concat(user_level) INTO sLevel FROM sys_user_info sui  where FIND_IN_SET(sui.proprietor,sTempChd)>0 and sui.is_delete = 0;
   SELECT group_concat(id) INTO sTempChd FROM sys_user_info sui  where FIND_IN_SET(sui.proprietor,sTempChd)>0 and sui.is_delete = 0;
  END WHILE;

 SELECT group_concat(t2.id) INTO resultStr FROM sys_user_info t2 WHERE  FIND_IN_SET(t2.id,sTemp)>0 AND DATEDIFF(t2.create_time,NOW())=0;



	RETURN CONCAT(substring(sLevel2,3),'--',IFNULL(resultStr,' '));
END */$$
