/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getSysUserChildListByLevel`(`rootId` INT, `userLevel` VARCHAR(50)) RETURNS varchar(1000) CHARSET utf8
    COMMENT '根据登录人id和角色，查出所有对应的子节点'
BEGIN
	
  DECLARE sTemp VARCHAR(1000);
	DECLARE sTempChd VARCHAR(1000);
  DECLARE resultStr VARCHAR(1000);
  SET sTemp = '';
  SET sTempChd =cast(rootId as CHAR);
  SET resultStr ='';
  WHILE sTempChd is not null DO
   SET sTemp = concat(sTemp,',',sTempChd);
   SELECT group_concat(id) INTO sTempChd FROM sys_user_info sui  where FIND_IN_SET(sui.proprietor,sTempChd)>0 
          and sui.is_delete = 0;
  END WHILE;
SELECT group_concat(id) INTO resultStr FROM sys_user_info WHERE  FIND_IN_SET(id,sTemp)>0 AND  FIND_IN_SET(user_level,userLevel);

	RETURN resultStr;
END */$$
